import React, { useState } from 'react';
import axios from 'axios';

const styles = {
    page: {
        display: 'flex',
        height: '100vh',
        width: '100vw',
        flexDirection: 'row-reverse',
        backgroundColor: '#f9f7f4',
    },
    formContainer: {
        flex: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        padding: '50px',
    },
    formBox: {
        width: '100%',
        maxWidth: '400px',
        textAlign: 'center',
        padding: '30px',
        backgroundColor: '#ffffff',
        boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
        borderRadius: '12px',
        fontFamily: "'Poppins', sans-serif",
    },
    header: {
        fontSize: '28px',
        color: '#d77a65',
        fontWeight: 'bold',
        marginBottom: '20px',
        fontFamily: "'Dancing Script', cursive",
    },
    group: {
        marginBottom: '15px',
    },
    label: {
        display: 'block',
        marginBottom: '5px',
        fontSize: '14px',
        fontWeight: '500',
        color: '#333',
    },
    input: {
        width: '100%',
        padding: '12px',
        borderRadius: '8px',
        border: '1px solid #ccc',
        fontSize: '16px',
        boxSizing: 'border-box',
        fontFamily: "'Poppins', sans-serif",
    },
    select: {
        width: '100%',
        padding: '12px',
        borderRadius: '8px',
        border: '1px solid #ccc',
        fontSize: '16px',
        boxSizing: 'border-box',
        backgroundColor: '#fff',
        fontFamily: "'Poppins', sans-serif",
    },
    button: {
        width: '100%',
        padding: '12px',
        backgroundColor: '#d77a65',
        color: '#fff',
        border: 'none',
        borderRadius: '8px',
        cursor: 'pointer',
        fontSize: '16px',
        marginTop: '20px',
        fontWeight: 'bold',
        transition: 'background-color 0.3s ease',
    },
    buttonHover: {
        backgroundColor: '#c5705d',
    },
    imageContainer: {
        flex: 1,
        position: 'relative',
        backgroundImage: "url('/path/to/your/image.png')", // Replace with the actual image path
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    overlayText: {
        position: 'absolute',
        color: '#ffffff',
        fontSize: '2rem',
        textAlign: 'center',
        padding: '30px',
        backgroundColor: 'rgba(0, 0, 0, 0.5)',
        borderRadius: '12px',
        fontFamily: "'Dancing Script', cursive",
    },
    error: {
        color: 'red',
        fontSize: '0.75rem',
    },
};

function RegistrationPage() {
    const [formData, setFormData] = useState({
        FName: '',
        LName: '',
        Email: '',
        UserName: '',
        Password: '',
        Area: 'North',
    });

    const [errors, setErrors] = useState({});
    const [successMessage, setSuccessMessage] = useState('');
    const [apiErrorMessage, setApiErrorMessage] = useState('');

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        // Validation logic and form submission here...
    };

    return (
        <div style={styles.page}>
            <div style={styles.formContainer}>
                <div style={styles.formBox}>
                    <h2 style={styles.header}>Welcome to Your Culinary Adventure!</h2>
                    <form onSubmit={handleSubmit}>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="FName">First Name:</label>
                            <input
                                style={styles.input}
                                type="text"
                                id="FName"
                                name="FName"
                                value={formData.FName}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="LName">Last Name:</label>
                            <input
                                style={styles.input}
                                type="text"
                                id="LName"
                                name="LName"
                                value={formData.LName}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="Email">Email:</label>
                            <input
                                style={styles.input}
                                type="email"
                                id="Email"
                                name="Email"
                                value={formData.Email}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="UserName">Username:</label>
                            <input
                                style={styles.input}
                                type="text"
                                id="UserName"
                                name="UserName"
                                value={formData.UserName}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="Password">Password:</label>
                            <input
                                style={styles.input}
                                type="password"
                                id="Password"
                                name="Password"
                                value={formData.Password}
                                onChange={handleChange}
                                required
                            />
                        </div>
                        <div style={styles.group}>
                            <label style={styles.label} htmlFor="Area">Area:</label>
                            <select
                                style={styles.select}
                                id="Area"
                                name="Area"
                                value={formData.Area}
                                onChange={handleChange}
                                required
                            >
                                <option value="North">North</option>
                                <option value="Center">Center</option>
                                <option value="Jerusalem">Jerusalem</option>
                                <option value="South">South</option>
                                <option value="Judea and Samaria">Judea and Samaria</option>
                                <option value="Abroad">Abroad</option>
                            </select>
                        </div>
                        <button style={styles.button} type="submit">Register</button>
                    </form>
                </div>
            </div>
            <div style={styles.imageContainer}>
                <div style={styles.overlayText}>
                    Glad to meet you! <br />
                    You're just a few clicks away from the most immersive online culinary experience.
                </div>
            </div>
        </div>
    );
}

export default RegistrationPage;
